package de.rwth.idsg.bikeman.domain;import lombok.Getter;import lombok.Setter;import lombok.ToString;import javax.persistence.CascadeType;import javax.persistence.DiscriminatorValue;import javax.persistence.Entity;import javax.persistence.FetchType;import javax.persistence.OneToOne;import javax.persistence.Table;@Entity@DiscriminatorValue("manager")@Table(name = "T_MANAGER")@Getter@Setter@ToStringpublic class Manager extends User {    private static final long serialVersionUID = 3531450923779190920L;    @OneToOne(cascade = CascadeType.ALL, fetch = FetchType.LAZY, mappedBy = "user")    private CardAccount cardAccount;}